i:77;s:5:\"5.2.2\";i:78;s:5:\"5.2.1\";i:79;s:5:\"5.2.0\";i:80;s:5:\"5.1.9\";i:81;s:5:\"5.1.8\";i:82;s:5:\"5.1.7\";i:83;s:5:\"5.1.6\";i:84;s:5:\"5.1.5\";i:85;s:5:\"5.1.4\";i:86;s:5:\"5.1.3\";i:87;s:5:\"5.1.2\";i:88;s:5:\"5.1.1\";i:89;s:5:\"5.1.0\";i:90;s:5:\"5.0.9\";i:91;s:5:\"5.0.8\";i:92;s:5:\"5.0.7\";i:93;s:5:\"5.0.6\";i:94;s:5:\"5.0.5\";i:95;s:5:\"5.0.4\";i:96;s:5:\"5.0.3\";i:97;s:5:\"5.0.2\";i:98;s:5:\"5.0.1\";i:99;s:5:\"5.0.0\";}s:6:\"tagged\";s:61:\"acf, advanced, custom, field, fields, form, repeater, content\";s:11:\"description\";s:1353:\"<p>Use the Advanced Custom Fields plugin to take full control of your WordPress edit screens & custom field data.</p>\n<p><strong>Add fields on demand.</strong> Our field builder allows you to quickly and easily add fields to WP edit screens with only the click of a few buttons!</p>\n<p><strong>Add them anywhere.</strong> Fields can be added all over WP including posts, users, taxonomy terms, media, comments and even custom options pages!</p>\n<p><strong>Show them everywhere.</strong> Load and display your custom field values in any theme template file with our hassle free developer friendly functions!</p>\n<h4>Features</h4>\n<ul>\n<li> Simple & Intuitive</li>\n<li> Powerful Functions</li>\n<li> Over 30 Field Types</li>\n<li> Extensive Documentation</li>\n<li> Millions of Users</li>\n</ul>\n<h4>Links</h4>\n<ul>\n<li> <a href=\"https://www.advancedcustomfields.com\">Website</a></li>\n<li> <a href=\"https://www.advancedcustomfields.com/resources/\">Documentation</a></li>\n<li> <a href=\"https://support.advancedcustomfields.com\">Support</a></li>\n<li> <a href=\"https://www.advancedcustomfields.com/pro/\">ACF PRO</a></li>\n</ul>\n<h4>PRO</h4>\n<p>The Advanced Custom Fields plugin is also available in a professional version which includes more fields, more functionality, and more flexibility! <a href=\"https://www.advancedcustomfields.com/pro/\">Learn more</a></p>\n\";s:12:\"installation\";s:508:\"<p>From your WordPress dashboard</p>\n<ol>\n<li> <strong>Visit</strong> Plugins > Add New</li>\n<li> <strong>Search</strong> for \"Advanced Custom Fields\"</li>\n<li> <strong>Activate</strong> Advanced Custom Fields from your Plugins page</li>\n<li> <strong>Click</strong> on the new menu item \"Custom Fields\" and create your first Custom Field Group!</li>\n<li> <strong>Read</strong> the documentation to <a href=\"https://www.advancedcustomfields.com/resources/getting-started-with-acf/\">get started</a></li>\n</ol>\n\";s:9:\"changelog\";s:8401:\"<h4>5.8.3</h4>\n<p><em>Release Date - 7 August 2019</em></p>\n<ul>\n<li> Tweak - Changed Options Page location rules to show \"page_title\" instead of \"menu_title\".</li>\n<li> Fix - Fixed bug causing Textarea field to incorrectly validate maxlength.</li>\n<li> Fix - Fixed bug allowing Range field values outside of the min and max settings.</li>\n<li> Fix - Fixed bug in block RegExp causing some blocks to miss the \"acf/pre_save_block\" filter.</li>\n<li> Dev - Added <code>$block_type</code> parameter to block settings \"enqueue_assets\" callback.</li>\n<li> i18n - Added French Canadian language thanks to Bérenger Zyla.</li>\n<li> i18n - Updated French language thanks to Bérenger Zyla.</li>\n</ul>\n<h4>5.8.2</h4>\n<p><em>Release Date - 15 July 2019</em></p>\n<ul>\n<li> Fix - Fixed bug where validation did not prevent new user registration.</li>\n<li> Fix - Fixed bug causing some \"reordered\" metaboxes to not appear in the Gutenberg editor.</li>\n<li> Fix - Fixed bug causing WYSIWYG field with delayed initialization to appear blank.</li>\n<li> Fix - Fixed bug when editing a post and adding a new tag did not refresh metaboxes.</li>\n<li> Dev - Added missing <code>$value</code> parameter in \"acf/pre_format_value\" filter.</li>\n</ul>\n<h4>5.8.1</h4>\n<p><em>Release Date - 3 June 2019</em></p>\n<ul>\n<li> New - Added \"Preview Size\" and \"Return Format\" settings to the Gallery field.</li>\n<li> Tweak - Improved metabox styling for Gutenberg.</li>\n<li> Tweak - Changed default \"Preview Size\" to medium for the Image field.</li>\n<li> Fix - Fixed bug in media modal causing the primary button text to disappear after editing an image.</li>\n<li> Fix - Fixed bug preventing the TinyMCE Advanced plugin from adding <code>< p ></code> tags.</li>\n<li> Fix - Fixed bug where HTML choices were not visible in conditional logic dropdown.</li>\n<li> Fix - Fixed bug causing incorrect order of imported/synced flexible content sub fields.</li>\n<li> i18n - Updated German translation thanks to Ralf Koller.</li>\n<li> i18n - Updated Persian translation thanks to Majix.</li>\n</ul>\n<h4>5.8.0</h4>\n<p><em>Release Date - 8 May 2019</em></p>\n<ul>\n<li> New - Added ACF Blocks feature for ACF PRO.</li>\n<li> Fix - Fixed bug causing duplicate \"save metabox\" AJAX requests in the Gutenberg editor.</li>\n<li> Fix - Fixed bug causing incorrect Repeater field value order in AJAX requests.</li>\n<li> Dev - Added JS filter <code>\'relationship_ajax_data\'</code> to customize Relationship field AJAX data.</li>\n<li> Dev - Added <code>$field_group</code> parameter to <code>\'acf/location/match_rule\'</code> filter.</li>\n<li> Dev - Bumped minimum supported PHP version to 5.4.0.</li>\n<li> Dev - Bumped minimum supported WP version to 4.7.0.</li>\n<li> i18n - Updated German translation thanks to Ralf Koller.</li>\n<li> i18n - Updated Portuguese language thanks to Pedro Mendonça.</li>\n</ul>\n<h4>5.7.13</h4>\n<p><em>Release Date - 6 March 2019</em></p>\n<ul>\n<li> Fix - Fixed bug causing issues with registered fields during <code>switch_to_blog()</code>.</li>\n<li> Fix - Fixed bug preventing sub fields from being reused across multiple parents.</li>\n<li> Fix - Fixed bug causing the <code>get_sub_field()</code> function to fail if a tab field exists with the same name as the selected field.</li>\n<li> Fix - Fixed bug corrupting field settings since WP 5.1 when instructions contain <code>< a target=\"\" ></code>.</li>\n<li> Fix - Fixed bug in Gutenberg where custom metabox location (acf_after_title) did not show on initial page load.</li>\n<li> Fix - Fixed bug causing issues when importing/syncing multiple field groups which contain a clone field.</li>\n<li> Fix - Fixed bug preventing the AMP plugin preview from working.</li>\n<li> Dev - Added new \'pre\' filters to get, update and delete meta functions.</li>\n<li> i18n - Update Turkish translation thanks to Emre Erkan.</li>\n</ul>\n<h4>5.7.12</h4>\n<p><em>Release Date - 15 February 2019</em></p>\n<ul>\n<li> Fix - Added missing function <code>register_field_group()</code>.</li>\n<li> Fix - Fixed PHP 5.4 error \"Can\'t use function return value in write context\".</li>\n<li> Fix - Fixed bug causing wp_options values to be slashed incorrectly.</li>\n<li> Fix - Fixed bug where \"sync\" feature imported field groups without fields.</li>\n<li> Fix - Fixed bug preventing <code>get_field_object()</code> working with a field key.</li>\n<li> Fix - Fixed bug causing incorrect results in <code>get_sub_field()</code>.</li>\n<li> Fix - Fixed bug causing draft and preview issues with serialized values.</li>\n<li> Fix - Fixed bug causing reversed field group metabox order.</li>\n<li> Fix - Fixed bug causing incorrect character count when validating values.</li>\n<li> Fix - Fixed bug showing incorrect choices for post_template location rule.</li>\n<li> Fix - Fixed bug causing incorrect value retrieval after <code>switch_to_blog()</code>.</li>\n<li> i18n - Updated Persian translation thanks to Majix.</li>\n</ul>\n<h4>5.7.11</h4>\n<p><em>Release Date - 11 February 2019</em></p>\n<ul>\n<li> New - Added support for persistent object caching.</li>\n<li> Fix - Fixed PHP error in <code>determine_locale()</code> affecting AJAX requests.</li>\n<li> Fix - Fixed bug affecting dynamic metabox check when selecting \"default\" page template.</li>\n<li> Fix - Fixed bug where tab fields did not render correctly within a dynamic metabox.</li>\n<li> Tweak - Removed language fallback from \"zh_TW\" to \"zh_CN\".</li>\n<li> Dev - Refactored various core functions.</li>\n<li> Dev - Added new hook variation functions <code>acf_add_filter_variations()</code> and <code>acf_add_action_variations()</code>.</li>\n<li> i18n - Updated Portuguese language thanks to Pedro Mendonça.</li>\n<li> i18n - Updated German translation thanks to Ralf Koller.</li>\n<li> i18n - Updated Swiss German translation thanks to Raphael Hüni.</li>\n</ul>\n<h4>5.7.10</h4>\n<p><em>Release Date - 16 January 2019</em></p>\n<ul>\n<li> Fix - Fixed bug preventing metaboxes from saving if validation fails within Gutenberg.</li>\n<li> Fix - Fixed bug causing unload prompt to show incorrectly within Gutenberg.</li>\n<li> Fix - Fixed JS error when selecting taxonomy terms within Gutenberg.</li>\n<li> Fix - Fixed bug causing jQuery sortable issues within other plugins.</li>\n<li> Tweak - Improved loading translations by adding fallback from region to country when .mo file does not exit.</li>\n<li> Tweak - Improved punctuation throughout admin notices.</li>\n<li> Tweak - Improved performance and accuracy when loading a user field value.</li>\n<li> Dev - Added filter \'acf/get_locale\' to customize the locale used to load translations.</li>\n<li> Dev - Added filter \'acf/allow_unfiltered_html\' to customize if current user can save unfiltered HTML.</li>\n<li> Dev - Added new data storage functions <code>acf_register_store()</code> and <code>acf_get_store()</code>.</li>\n<li> Dev - Moved from .less to .scss and minified all css.</li>\n<li> i18n - Updated French translation thanks to Maxime Bernard-Jacquet.</li>\n<li> i18n - Updated Czech translation thanks to David Rychly.</li>\n</ul>\n<h4>5.7.9</h4>\n<p><em>Release Date - 17 December 2018</em></p>\n<ul>\n<li> Fix - Added custom metabox location (acf_after_title) compatibility with Gutenberg.</li>\n<li> Fix - Added dynamic metabox check compatibility with Gutenberg.</li>\n<li> Fix - Fixed bug causing required date picker fields to prevent form submit.</li>\n<li> Fix - Fixed bug preventing multi-input values from saving correctly within media modals.</li>\n<li> Fix - Fixed bug where <code>acf_form()</code> redirects to an incorrect URL for sub-sites.</li>\n<li> Fix - Fixed bug where breaking out of a sub <code>have_rows()</code> loop could produce undesired results.</li>\n<li> Dev - Added filter \'acf/connect_attachment_to_post\' to prevent connecting attachments to posts.</li>\n<li> Dev - Added JS filter \'google_map_autocomplete_args\' to customize Google Maps autocomplete settings.</li>\n</ul>\n<h4>5.7.8</h4>\n<p><em>Release Date - 7 December 2018</em></p>\n<ul>\n<li> Fix - Fixed vulnerability allowing author role to save unfiltered HTML values.</li>\n<li> Fix - Fixed all metaboxes appearing when editing a post in WP 5.0.</li>\n<li> i18n - Updated Polish translation thanks to Dariusz Zielonka.</li>\n<li> i18n - Updated Czech translation thanks to Veronika Hanzlíková.</li>\n<li> i18n - Update Turkish translation thanks to Emre Erkan.</li>\n<li> i18n - Updated Portuguese language thanks to Pedro Mendonça.</li>\n</ul>\n\";s:14:\"upgrade_notice\";s:0:\"\";s:5:\"icons\";a:1:{s:7:\"default\";s:63:\"https://ps.w.org/advanced-custom-fields/assets/icon-256x256.png\";}}', 'no'),
